using System;
using System.Collections;
using System.Collections.Generic;
using System.Linq;
using UnityEngine;
using KModkit;
using Rnd = UnityEngine.Random;
using System.IO;
using UnityEngine.UI;

public class PurgatorysNameList : MonoBehaviour
{
    private KMBombModule bombModule;
    private Button[] buttons = new Button[8];
    private string correctName;
    static int ModuleIdCounter = 1;
    int ModuleId;
    private bool ModuleSolved;

    bool isInitialization;
    bool isAnimating;

    void Awake()
    {
        ModuleId = ModuleIdCounter++;
        isInitialization = true;
        for (int i = 1; i < 9; i++)
        {
            int dummy = i;
            KMSelectable selectable = transform.Find($"StickFigure {dummy}").GetComponent<KMSelectable>();
            selectable.OnInteract += delegate () { ButtonPress(selectable); return false; };
            Text text = transform.Find($"StickFigure {dummy}/Canvas/Text").GetComponent<Text>();
            buttons[dummy - 1] = new Button(selectable, text);
        }
        bombModule = GetComponent<KMBombModule>();
        bombModule.OnActivate += OnActivate;
    }

    void Start()
    {
        HideAllFigures();
        SetUpMod();
    }

    void Update()
    {

    }

    private void SetUpMod()
    {
        
        correctName = newNames.PickRandom();
        string[] wrongNames = RandomizeList(oldNames, 7).ToArray();
        List< string> names = new List<string> { correctName };
        names.AddRange(wrongNames);
        names = RandomizeList(names, 8);

        for(int i = 0; i < 8; i++)
        {
            buttons[i].Text.text = names[i];
        }

        Logging($"Names are {string.Join(", ", names.ToArray())}");
        Logging($"Correct person is: {correctName}");

        if (!isInitialization)
        {
            StartCoroutine(FiguresAnimation(true, .3f));
        }
    }

    private void ButtonPress(KMSelectable selectable)
    {
        if (ModuleSolved || isAnimating) return;
        selectable.AddInteractionPunch(1f);
        Button slectedButton = buttons.First(b => b.Selectable == selectable);
        string selectedName = slectedButton.Text.text;
        Logging($"You chose {selectedName}");
        if (selectedName == correctName) 
        {
            StartCoroutine(Solve());

        }
        else
        {
            StartCoroutine(Strike());
        }
    }

    private void OnActivate()
    {
        StartCoroutine(FiguresAnimation(true, .3f));
        isInitialization = false;
    }
    private void HideAllFigures()
    {
        foreach (Button button in buttons) {
            button.Selectable.gameObject.SetActive(false);
        }
    }

    private IEnumerator FiguresAnimation(bool show, float time, bool solve = false)
    {
        isAnimating = true;
        foreach (Button button in buttons)
        {
            if (solve && button.Text.text == correctName)
            {
                continue;
            }
            button.Selectable.gameObject.SetActive(show);
            yield return new WaitForSeconds(time);
        }
        isAnimating = false;
    }


    private List<string> RandomizeList(List<string> orgininal, int count)
    {
        List<string> newList = new List<string>();
        List<string> oldList = new List<string>(orgininal);
        while (oldList.Count > 0 && newList.Count != count)
        {
            string result = oldList.PickRandom();
            oldList.Remove(result);
            newList.Add(result);
        }
        return newList;
    }

    private IEnumerator Solve()
    {
        yield return FiguresAnimation(false, .1f, true);

        GetComponent<KMBombModule>().HandlePass();
        ModuleSolved = true;
    }

    private IEnumerator Strike()
    {
        GetComponent<KMBombModule>().HandleStrike();
        yield return FiguresAnimation(false, .1f);
        Logging($"Strike! Resetting module...");
        yield return new WaitForSeconds(.5f);
        SetUpMod();
    }

    private void Logging(string message)
    {
        Debug.Log($"[Purgatory's Name List #{ModuleId}] {message}");
    }

#pragma warning disable 414
    private readonly string TwitchHelpMessage = @"Use !{0} followed by the a name to selected that person";
#pragma warning restore 414

    IEnumerator ProcessTwitchCommand(string Command)
    {
        yield return null;
        Command = Command.ToUpper().Trim();
        string[] names = buttons.Select(b => b.Text.text.ToUpper()).ToArray();
        if (names.Contains(Command))
        {
            buttons.First(b => b.Text.text.ToUpper() == Command).Selectable.OnInteract();
        }
        else
        {
            yield return $"sendtochaterror \"{Command}\" is not a person on the mod";
        }
    }

    IEnumerator TwitchHandleForcedSolve()
    {
        yield return ProcessTwitchCommand(correctName);
        while (!ModuleSolved)
        {
            yield return true;
        }
    }

